	add("bruin", "{\"term\":\"bruin\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\"], \"text\":\"From Middle dutch (ca. 1050-1350) \u0027bruin\u0027 (brown) via William Caxton\u0027s 1485 translation of a Dutch version of the legend of w:Reynard|Reynard the Fox. \u0027Bruin\u0027 is the bear, named for his brown color.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A folk name for a bear, especially the brown bear, \u0027Ursus arctos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, translating Elias Lönnrot, \u0027The Kalevala\u0027, XVII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The mother sought the one gone / astray, for the lost she longs: / she ran great swamps as a wolf / trod the wilds as a \u0027\u0027bruin\u0027\u0027 / waters as an otter roamed […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brumby", "{\"term\":\"brumby\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Unknown; perhaps from James Brumby, early Australian farrier, who is said to have left horses at his abandoned property.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wild or feral horse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, December 22, \u0027w:Life Life\u0027, [http://books.google.com/books?id\u003da0oEAAAAMBAJ\u0026amp;pg\u003dPA68\u0026amp;dq\u003d%22brumby%7Cbrumbies%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003dsb-eTr7NH8WQsQKk7OGRCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEwQ6AEwB\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22brumby%7Cbrumbies%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 69\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He captures \u0027\u0027brumbies\u0027\u0027, the wild horses of the outback, running them down on motorcycles and shipping them to the city where they are butchered for pet food\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Tom Lee McKnight, \u0027Friendly Vermin: A Survey of Feral Livestock in Australia\u0027, [http://books.google.com/books?id\u003dPzioYxMKNIwC\u0026amp;pg\u003dPA17\u0026amp;dq\u003d%22brumby%7Cbrumbies%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003d_cGeTv67HKOEsgKC-5jpCQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEYQ6AEwBTg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22brumby%7Cbrumbies%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 17\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If the latter situation prevails, \u0027\u0027brumbies\u0027\u0027 can be developed into valuable stockhorses, either for use on the local property or for sale in other areas\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Whatever the condition of a captured \u0027\u0027brumby\u0027\u0027, there is always the potential of selling it for pet food, fish bait, or even for human consumption\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Tom Cole, \u0027Hell West and Crooked\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Harry Farquharson said there were two or three springs and that the horses were “bloody wild”. He said there were probably about 300 and they were good horses, a long way above the average \u0027\u0027brumby\", \"priority\":10}]}, \"synonyms\":{}}");

	add("brummie", "{\"term\":\"brummie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Birmingham, United Kingdom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, David Franklin, \u0027Looking For Sarah Jane Smith\u0027, Baby Ice Dog Press, Australia, ISBN 9780646410869, [http://books.google.com.au/books?id\u003dT2Gax6htdHwC\u0026amp;pg\u003dPT38\u0026amp;dq\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcJP3UavGMcuFlAW12oGQDg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"John figured that people who said \u0027Ciao\u0027 were asking to be damaged, especially \u0027\u0027Brummies\u0027\u0027 with dreary accents who sounded even more absurd than other non-Italian \u0027Ciao\u0027 users\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Steve Mifflin, \u0027Exile in the Promised Land\u0027, 2013, [http://books.google.com.au/books?id\u003d5Wmj3cIqPgIC\u0026amp;pg\u003dPA120\u0026amp;dq\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcJP3UavGMcuFlAW12oGQDg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;f\u003dfalse page 120\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"His drilled shot is inch perfect and initially I am frozen as the ball hits the back of the net, in front of the open mouthed \u0027\u0027Brummies\u0027\u0027 massed behind the goal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Bryan Connor, \u0027Voices from a Blue Box: Tales from a Black Country Copper\u0027, [http://books.google.com.au/books?id\u003daQbK1z6NSKkC\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcJP3UavGMcuFlAW12oGQDg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;f\u003dfalse page 15\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The truth is that these days the \u0027\u0027Brummies\u0027\u0027 have been magnanimous enough to recognise that the Black Country exists and thats at least a start\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The accented variety of English spoken in Birmingham\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 August 11, TerryD, \u0026quot;[https://groups.google.com/forum\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"topic/uk.rec.naturist/UBuyn7ARWVo Skinny-Dipping Midlands]\u0026quot;, uk.rec.naturist, Usenet\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An easy mistake to make though, you\u0027ll hear more \u0027\u0027Brummie\u0027\u0027 in Welshpool in August than Welsh that\u0027s for sure\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Kamil Malarski, \u0027Intonation in the Perception of \u0027\u0027Brummie\u0027\u0027\u0027, Ewa Waniek-Klimczak, Linda R. Shockey (editors), \u0027Teaching and Researching English Accents in Native and Non-native Speakers\u0027, Springer, [http://books.google.com.au/books?id\u003dz1xmEbJA6n8C\u0026amp;pg\u003dPA208\u0026amp;dq\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcJP3UavGMcuFlAW12oGQDg\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Brummie%22%7C%22Brummies%22\u0026amp;f\u003dfalse page 208\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Brummie\u0027\u0027 is the accent spoken in the city of Birmingham in the area of the West Midlands. Despite its being widely discussed in the media, \u0027\u0027Brummie\u0027\u0027 has not received too much attention from linguists\", \"priority\":17}]}, \"synonyms\":{}}");

	add("brunt", "{\"term\":\"brunt\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027brundr\u0027 \u0027brundtið\u0027 (oestrus, rut) or \u0027bruna\u0027 (to rush)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The full adverse effects of; the chief consequences or negative results of a thing or event\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Unfortunately, poor areas such as those in New Orleans bore the \u0027\u0027brunt\u0027\u0027 of Hurricane Katrina\u0027s winds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 31, David M. Halbfinger, \u0026quot;[http://www.nytimes.com/2012/11/01/nyregion/new-jersey-continues-to-cope-with-hurricane-sandy.html?hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 31 October 2012)\u0026lt;/small\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Though the storm raged up the East Coast, it has become increasingly apparent that New Jersey took the \u0027\u0027brunt\u0027\u0027 of it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The major part of; the bulk\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If you feel tired of walking, just think of the poor donkey who has carried the \u0027\u0027brunt\u0027\u0027 of our load\", \"priority\":6}]}, \"synonyms\":{}}");

