	add("brush", "{\"term\":\"brush\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"middle high german (ca. 1050-1500)\"], \"text\":\"Middle english (1100-1500) \u0027brusshe\u0027 from Old french (842-ca. 1400) \u0027broisse\u0027 (compare Modern French \u0027brosse\u0027 from {{m|la|*bruscia}} from Proto-germanic {{m|gem-pro|*bruskaz||underbrush}}, from Proto-indo-european {{m|ine-pro|*bhreus-||to swell, sprout}}. Akin to Middle high german (ca. 1050-1500) \u0027bürste\u0027 (brush) Old english (ca. 450-1100) \u0027byrst\u0027 (bristle) Middle high german (ca. 1050-1500) \u0027broz\u0027 (a bud, shoot) Old english (ca. 450-1100) {{m|ang|brēost||breast}}, Proto-Slavic {{m|sla-pro|*bъrščь||hogweed}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An implement consisting of multiple more or less flexible bristles or other filaments attached to a handle, used for any of various purposes including cleaning, painting, and arranging hair\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A piece of conductive material, usually carbon, serving to maintain electrical contact between the stationary and rotating parts of a machine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of brushing something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As leaves] have with one winter\u0027s \u0027\u0027brush\u0027\u0027 / Fell from their boughs\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Wild vegetation, generally larger than grass but smaller than trees Wikipedia\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, Jack London, s:Before Before Adam, s:Before Adam/Chapter chapter 12\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"We break broke away toward the north, the tribe howling on our track. Across the open spaces we gained, and in the \u0027\u0027brush\u0027\u0027 they catch caught up with us, and more than once it was nip and tuck\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL4103950W Internal passage\u003dOne typical Grecian kiln engorged one thousand muleloads of juniper wood in a single burn. Fifty such kilns would devour six thousand metric tons of trees and \u0027\u0027brush\u0027\u0027 annually\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A short and sometimes occasional encounter or experience\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Russell Brand, \u0027[http://www.theguardian.com/culture/2013/sep/13/russell-brand-gq-awards-hugo-boss Russell Brand and the GQ awards: \u0026lt;nowiki\u0026gt;\u0027It\u0027s amazing how absurd it seems\u0027\u0026lt;/nowiki\u0026gt;]\u0027, \u0027The Guardian\u0027, 13 September\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The usual visual grammar was in place – a carpet in the street, people in paddocks awaiting a \u0027\u0027brush\u0027\u0027 with something glamorous, blokes with earpieces, birds in frocks of colliding colours that if sighted in nature would indicate the presence of poison\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The furry tail of an animal, especially of a fox\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"They burned the old gun that used to stand in the dark corner up in the garret, close to the stuffed fox that always grinned so fiercely. Perhaps the reason why he seemed in such a ghastly rage was that he did not come by his death fairly. Otherwise his pelt would not have been so perfect. And why else was he put away up there out of sight?\u0026amp;mdash;and so magnificent a \u0027\u0027brush\u0027\u0027 as he had too\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A tuft of hair on the mandibles\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A short contest, or trial, of speed\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Cornhill Magazine\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Let us enjoy a \u0027\u0027brush\u0027\u0027 across the country\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"An instrument, resembling a brush, used to produce a soft sound from drums or cymbals\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An on-screen tool for \u0026quot;painting\u0026quot; a particular colour or texture\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Lee Lanier, \u0027Maya Professional Tips and Techniques\u0027, p.12\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Your bitmap image appears along the painted stroke. If you\u0027d like to permanently create a custom sprite \u0027\u0027brush\u0027\u0027, it\u0027s fairly easy to adapt an existing MEL file\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"In 3D video games, a convex polyhedron, especially one that defines structure of the play area. \u0026lt;!--e.g. in the game \u0026quot;Quake\u0026quot;... others?--\u0026gt\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The floorperson of a poker room, usually in a casino\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"North Wisconsin, uncountable) Evergreen boughs, especially balsam, locally cut and baled for export, usually for use in wreathmaking\", \"priority\":25}]}, \"synonyms\":{}}");

